export const templates = {
  bear: {
    name: 'рЃЊрЃљрЃЌрЃЋрЃў',
    parts: [
      {
        name: 'рЃЌрЃљрЃЋрЃў',
        path: [
          { x: 300, y: 100 },
          { x: 350, y: 120 },
          { x: 360, y: 150 },
          { x: 350, y: 180 },
          { x: 300, y: 200 },
          { x: 250, y: 180 },
          { x: 240, y: 150 },
          { x: 250, y: 120 },
          { x: 300, y: 100 }
        ],
        tolerance: 20,
        color: '#795548'
      },
      {
        name: 'рЃЏрЃБрЃфрЃћрЃџрЃў',
        path: [
          { x: 280, y: 200 },
          { x: 320, y: 200 },
          { x: 350, y: 250 },
          { x: 320, y: 300 },
          { x: 280, y: 300 },
          { x: 250, y: 250 },
          { x: 280, y: 200 }
        ],
        tolerance: 20,
        color: '#795548'
      },
      {
        name: 'рЃДрЃБрЃарЃў_рЃЏрЃљрЃарЃфрЃ«рЃћрЃюрЃљ',
        path: [
          { x: 260, y: 110 },
          { x: 240, y: 90 },
          { x: 260, y: 70 },
          { x: 280, y: 90 },
          { x: 260, y: 110 }
        ],
        tolerance: 15,
        color: '#795548'
      },
      {
        name: 'рЃДрЃБрЃарЃў_рЃЏрЃљрЃарЃ»рЃЋрЃћрЃюрЃљ',
        path: [
          { x: 340, y: 110 },
          { x: 320, y: 90 },
          { x: 340, y: 70 },
          { x: 360, y: 90 },
          { x: 340, y: 110 }
        ],
        tolerance: 15,
        color: '#795548'
      },
      {
        name: 'рЃфрЃ«рЃЋрЃўрЃарЃў',
        path: [
          { x: 290, y: 150 },
          { x: 310, y: 150 },
          { x: 300, y: 160 },
          { x: 290, y: 150 }
        ],
        tolerance: 10,
        color: '#000000'
      }
    ],
    compliments: [
      'рЃДрЃЮрЃЕрЃљрЃд! рЃФрЃљрЃџрЃўрЃљрЃю рЃџрЃљрЃЏрЃљрЃќрЃў рЃЊрЃљрЃЌрЃЋрЃў рЃњрЃљрЃЏрЃЮрЃњрЃўрЃЋрЃўрЃЊрЃљ! ­Ъљ╗',
      'рЃерЃћрЃАрЃљрЃюрЃўрЃерЃюрЃљрЃЋрЃўрЃљ! рЃЊрЃљрЃЌрЃЋрЃў рЃФрЃљрЃџрЃўрЃљрЃю рЃЎрЃљрЃарЃњрЃљрЃЊ рЃЊрЃљрЃ«рЃљрЃбрЃћ! ­ЪЉЈ',
      'рЃАрЃљрЃЮрЃфрЃљрЃарЃўрЃљ! рЃюрЃљрЃЏрЃЊрЃЋрЃўрЃџ рЃЏрЃ«рЃљрЃбрЃЋрЃљрЃарЃА рЃ░рЃњрЃљрЃЋрЃ«рЃљрЃа! ­Ъје',
      'рЃЋрЃљрЃБ! рЃарЃљ рЃЎрЃљрЃарЃњрЃљрЃЊ рЃњрЃљрЃЏрЃЮрЃњрЃўрЃЋрЃўрЃЊрЃљ! ­ЪїЪ',
      'рЃЉрЃарЃљрЃЋрЃЮ! рЃерЃћрЃюрЃў рЃЊрЃљрЃЌрЃЋрЃў рЃФрЃљрЃџрЃўрЃљрЃю рЃАрЃљрЃДрЃЋрЃљрЃарЃћрЃџрЃўрЃљ! РЮц№ИЈ'
